n,kk=map(int,input().split())

dp=[[[0]*(n**2+1) for _ in range(n+1)] for _ in range(n+1)]
dp[0][0][0]=1

for i in range(1,n+1):
  for j in range(i+1):
    for k in range(n**2+1):
      if k-2*j<0:
        continue
      dp[i][j][k]=(2*j+1)*dp[i-1][j][k-2*j]  
      if j+1<=n:
        dp[i][j][k]+=(j+1)**2*dp[i-1][j+1][k-2*j]
      if j-1>=0:
        dp[i][j][k]+=dp[i-1][j-1][k-2*j]
      dp[i][j][k]%=MOD

print(dp[n][0][kk])

